B.D_=new A.az(6,{image:"lib/assets/lilme.png",imgDesc:"Halloween, me as a TV",headline:"This is me!",p1:"I grew up in Denver, CO and have lived in Los Angeles and New York City in the past, but I'm back to calling Denver home.",p2:"I hold a Bachelors degree in Business Administration with a focus on Economics from CUNY Baruch College, and a Certificate from the University of Denver's Full Stack Web Development Bootcamp.",p3:""},B.fw,t.l)
