B.CZ=new A.az(6,{image:"lib/assets/oliver0.jpg",imgDesc:"",headline:"Fun Facts",p1:"I've visited 48 out of the 50 states, and Grand Rapids, MI was the memorable surprise.  I visited during ArtPrize which is a city wide indoor/outdoor art competition so inspiring art was everywhere you went!",p2:'I can speak and read French on a "casual" level.  After seeing a movie (Jeux D\'Enfants) in a theater in NYC I decided to take up French lessons in my free time for the next 4 years.  This made visiting Montreal, Quebec, and Paris much more enjoyable!',p3:"I started picking up bar and restaurant gigs just for fun and discovered I loved working in the industry, so I bartended and served for several years.  If you're from Denver, I worked at Mile High Spirits, Tap XIV/Hayters, The Pig & The Sprout, For[a]ged, Dimestore Deli bar, and Sushi Rama/Osaka Ramen.  I always started at the bottom but worked my way up to manage at Sushi Rama, went from food running to bartending at For[a]ged and The Pig & The Sprout, and held jobs in both bartending and production at Mile High Spirits.  I've you've had the Denver Dry Gin, I might have blended and bottled your batch!  I also gave educational tours of the distillery showing people how we transformed raw ingredients into a variety of spirits!"},B.fw,t.l)
