B.Di=new A.az(5,{name:"NightLife Website Demo",stack:"React, Bootstrap",image:"lib/assets/nightclub.gif",git:"",description:"This site was my take on a creative layout with a lively theme that incorporates sliding panels with moving backgrounds.  Having worked in the restaurant and bar industry for years this is the sort of website I would envision for many of the places I worked at.  Their actual websites were always lifeless, so the goal here was pizazz, and a demo in using state to make layout changes on the flu."},B.fy,t.l)
B.Dk=new A.az(5,{name:"Denver Train Tracker",stack:"Flutter & Dart, Google API, GTFS-RT",image:"lib/assets/train1.gif",git:"https://github.com/Pierre81385/rtd_flutter",description:"I recently found the need to find a way to quickly determine if my girlfriends train was close to arriving at our station every morning when I dropped her off.  And on her way home I wanted to know when she'd be arriving so I wasn't wasting time waiting for her if the train was running late. But the public site for this information was so slow to load and the UI was so cluttered you could barely see the map when it did!  So I created this to fill that need and out of a curiosity about how to consume GTFS-RT data feeds and how to use polyline data with Google Maps.  I quickly found there was loads of interesting information I could add to my app after exploring the various responses, and decided to add alert information, train stop locations, color coded routes.  This app is currently in testing through Apple TestFlight but I plan to submit it to the App Store soon so stay tuned!"},B.fy,t.l)
B.Dj=new A.az(5,{name:"MatchDotDog",stack:"Flutter & Dart, Google API, Firebase Auth, Firestore, and ImagePicker",image:"lib/assets/match.gif",git:"",description:"Finding a playmate for your dog can be a lot like dating, so I created an app to find the perfect pal for your pup!  Features include the ability to create multiple dog profiles linked to an owner account, chat functionality, a map view, card stacks that show detailed info about each dog near you (distance included), and the ability to make a friends list!"},B.fy,t.l)
